import React, { useState, useEffect } from 'react';
import './Navbar.css';

function Navbar() {
  const [click, setClick] = useState(false);
  const [button, setButton] = useState(true);

  const handleClick = () => setClick(!click);
  const closeMobileMenu = () => setClick(false);

  const showButton = () => {
    if (window.innerWidth <= 960) {
      setButton(false);
    } else {
      setButton(true);
    }
  };

  useEffect(() => {
    showButton();
  }, []);

  window.addEventListener('resize', showButton);

  return (
    <nav className="navbar">
      <a href="/" className="navbar__logo">ALIEN</a>
      <div className="navbar__bars"><i class="fas fa-bars"></i></div>
      <div className="navbar__menu">
        <a href="/" className="navbar__menu--links">Home</a>
        <a href="/" className="navbar__menu--links">Products</a>
        <a href="/" className="navbar__menu--links">Services</a>
        <a href="/" className="navbar__menu--links" id="button">Sign Up</a>
      </div>
    </nav>
  );
}

export default Navbar;
